import React from 'react';
import {CircularProgress} from "@mui/material";
import {Visualization} from "../types/visualization.type";
import {AppState} from "../types/appState.type";
import {FilterType, SearchFilter} from "../../searchFilters/types/searchFilters.type";
import { SearchFilters } from '../../searchFilters/components/searchFilters.component';

export class SearchPage extends React.Component<any, {
    visualizations:Visualization[],
    appState: AppState,
    searchFilters: SearchFilter[]
}>{
    constructor(props:any) {
        super(props);
        this.state = {
            visualizations:[],
            appState: AppState.ready,
            searchFilters: [{filterType:FilterType.name,filterValue:'hello'}]
        };
    }
    componentDidMount() {
    }

    updateFilters = (searchFilters:SearchFilter[])=>this.setState({searchFilters})

    render() {
        return <>
            <SearchFilters searchFilters={this.state.searchFilters} updateFilters={this.updateFilters}/>
        </>
    }
}
